Autopsija turėjo išaiškinti mirties priežastį, tačiau „Florida District Six Medical Examiner’s“ atliktas tyrimas iškėlė naujų klausimų. Teigiama net, kad R. Piana kaip narkotiką uostė ir kofeino miltelius. Vis dar trūkstant paaiškinimų keliamos net sąmokslo teorijos. Anot autopsijos rezultatų, R. Pianos mirties priežasčių gali būti daug. Tyrimas atskleidė gąsdinančius ekstremalaus kultūristo pokyčius. Papildų linijos įkūrėjas turėjo didelių širdies problemų. Po skrodimo paaiškėjo, kad jo širdis ir kepenys yra net dukart didesni nei paprasto suaugusio žmogaus. Prastos būklės taip pat buvo inkstai ir skydliaukė, kalbama ir apie suriebėjusias kepenis, kokios paprastai aptinkamos ilgai alkoholį vartojusių žmonių organizme. Tiksliai diagnozei nustatyti trukdo ir viešai žinomas sportininko ilgametis dopingo bei narkotikų vartojimas. Dar 2014-aisiais R. Piana sukėlė tikrą skandalą, kai atvirai prabilo apie tai, kad nuo jaunystės vartoja anabolinius steroidus, o norintiems rinktis šį pavojingą greitų rezultatų kelią dalijo patarimus. Toksikologinis tyrimas šiuo atveju turėjo duoti esminius atsakymus, tačiau paaiškėjo, kad policija jo laiku atlikti nesugebėjo. Priežastis – pareigūnai pavėluotai kreipėsi dėl buvusio „Misterio Kalifornija“ kraujo mėginių – šiuos praėjus trim dienoms ligoninė įprastine tvarka naikina. Negalima paneigti įtarimo, kad R. Pianos mirties priežastis galėjo būti ir narkotikai. Sportininko bute policija aptiko 20 pakuočių anabolinių steroidų, o taip pat įtartinų baltų miltelių su susukta tūtele. Už akių užbėgusi velionio draugė Chanel Jansen tvirtino, kad milteliai yra ne kas kita, o kultūristų paprastai prieš treniruotę su vandeniu sumaišoma ir geriama medžiaga. Moters teigimu R. Piana tuos kofeino miltelius didelėmis dozėmis uodė kaip kokainą per nosį užuot gėręs. Kol tikrosios R. Pianos mirties priežastys lieka neapčiuoptos, buvęs kultūristas ir velionio draugas 49-erių metų Dave'as Polumbo įtaria sąmokslą. Anot jo, daug draugų, o taip pat daug priešų turėjęs R. Piana po mirties nepakankamai ištirtas, kliūna ir toksikologinio tyrimo trūkumas. D. Polumbo nuomone, ekstremalaus kultūristo atvejis turi būti ištirtas nuodugniau, tai padėtų ir jo draugei, kuri iki šiol negali susitaikyti su R. Pianos mirtimi. Įdomu, kad su šia įžymybe dar šių metų pavasarį gyvai bendravo Lietuvos reperis  Ironvytas . Aistringas didelių raumenų šalininkas jau daug metų mina įvairių šalių sporto klubų slenksčius, viena iš tokių galimybių balandžio mėnesį pasinaudojo ir būdamas Vokietijoje. „Kelne po parodos internete susiradau patį  hardcoriškiausią  šio miesto sporto klubą, buvau labai pavargęs, bet ėjau iki jo apie 40 minučių ir nepasigailėjau. Visiškai to nesitikėdamas pamačiau tame rūsyje sportuojantį Pianą ir visą jo  freak'us  draugus“, – DELFI pasakojo Ironvytas. Reperis tęsė: „Mane užliejo tokia motyvacija. Tas žmogus spinduliavo užkrečiama energija sportui. Būdamas tokio lygio žvaigžde jis buvo labai paprastas su visais. Kalbėjosi ir fotografavosi sportuodamas. Pas mus priimta, kad kultūristas uždaras ir piktas žmogus. Kaip parodė vėliau, visi blogeriai ir instagramo sekėjai – geru žodžiu jį minėjo“. (function(d, s, i, r) {
