		})(document, 'script', 'facebook-jssdk', 'fb-root'); – Kodėl jis vadinamas šio sporto žvaigžde?  – paklausiau Ironvyto. – Jis nėra žymus kultūrizmo laimėjimais, o labiau žinomas kaip asmenybė. Jis yra vienas pirmųjų blogerių, pradėjęs atvirai pasakoti apie vartojamus steroidus. Aišku, kai ką jis nutylėdavo. Pavyzdžiui, narkotikus, kurie veikiausiai ir yra svariausia jo gyvenimo baigties priežasčių. – R. Piana sutinkamas gana prieštaringai – juk į internetą kėlė vaizdo klipus, kur pasakojo apie anabolinius steroidus ir pateikė save kaip sėkmingą šio kelio pavyzdį? – Kiek mačiau video, niekuomet nepropagavo anabolinių steoridų. Atvirkšiai, jis visuomet akcentuodavo ir klausdavo: ar esate 100 proc. tikri, kad jums to reikia? Jis kvietė sportuoti maksimaliai sveikai, bet norintiems maksimalių raumenų apimčių duodavo patarimus. Žinoma, tai komercija ir gali būti ne visai nuoširdu – tokiu būdu jis išpopuliarėjo ir išleido savo papildų liniją. Kita vertus, galbūt tai ir yra toks tragiškai geras pavyzdys, kai žmogus rodė, ką vartoti, „norint augti“ ir mirė. Jaunam žmogui verta susimąstyti dėl tokių pasekmių. – Kaip galima paaiškinti tą nepalenkiamą norą nepaisant priemonių tapti didesniu, jei kalbame apie ekstremalų raumenų auginimą? – Dabar visi visko nori greitai – pavalgyti, pinigų, tapti žvaigžde. Nenuostabu, kad jaunas žmogus nori tapti sėkmingu kultūristu greitai, sudalyvauti varžybose, atėjęs kūdas jau kitą sezoną pasitikti raumeningas ir gražus. Taip nebūna. Nenorėdami vargti ir ieškodami lengviausio kelio kiti renkasi tokį neleistiną būdą. Tačiau kad ir ką jie vartotų, nepasiekia to, ką galima pasiekti per disciplinuotą sportą. Tas pats Piano prisipažino, kad vartojo steroidus 20 metų. Kiti įsivaizduoja, kad per metus taps tokiais „dideliais“. Visi nori greitų rezultatų dabar, bet ačiū Dievui, kad dar yra ir toks sveikatos kultas. Jis šiek tiek atsveria tą greitų rezultatų norą. – Pats sportuojate ne vienerius metus, ar teko sutikti daug tokių jaunuolių, norinčių greitai, čia ir dabar? Septynerius metus turiu savo papildų parduotuvę, tai populiariausi žmonių poreikiai yra tokie – man reikia greitai užauginti masę arba numesti riebalą. To nori ne tik lietuviai. Ir užsieniečiai užėjo šią savaitę ir klausia, koks stipriausias riebalų deginimo papildas? Įdomu, kad nekyla klausimas, koks sveikiausias. Jaunimas taip pat klausia, koks proteinas greičiausiai priaugina masės. Dar juokinga būna, kai parodo 20 metų sportuojančio kultūristo nuotrauką ir klausia, kiek reikia išgerti proteino, kad tokiu taptų. Lietuvoje yra įstatymai, baudžiantys už dopingą, tai jaunam žmogui visas tas draudžiamas medžiagas surasti ganėtinai sunku. Tai nėra taip paplitę, ir tai džiugina. O tokie pavyzdžiai kaip Richo Pianos, kad ir kaip baisiai tai skambėtų, į naudą. – R. Pianos draugė tvirtino, kad jis uostė taip vadinamus „preworkout“ miltelius. Ar tai yra išvis įmanoma? – Mitas. Milteliai ir susukta  triūbelė . Tai draugės mėginimas apginti jo garbę, todėl ir sakė, kad tuos prieš treniruotę išgerti skirtus miltelius uosto. Tai yra visiška nesąmonė. Vieša paslaptis, kad šis žmogus smarkiai uostė kokainą ir vartojo kitus narkotikus. Juokiamės, kad galėjo to nesakyti, nes dabar vaikai mėgins uostyti „ preworkout “ miltelius, o pasekmės liūdnos – išdeginta gleivinė. Paprašyta pakomentuoti, kodėl būtent kultūrizme taip paplitusi draudžiama medžiaga anaboliniai steroidai, Lietuvos antidopingo agnetūros medicinos srities vadybininkė  Rūta Banytė  aiškino paprastai – tai padeda greičiau auginti raumeninę masę. „Ši medžiaga dažniausiai vartojama tam, kad įdedant mažiau pastangų būtų gaunami geresni rezultatai, taip pat vartojant kartu su kitais preparatais padeda ilgiau treniruotis ir greičiau atsistatyti, – pasakojo ji ir priminė apie liūdnas pasekmes. „Ilgai vartojant būna nuotaikų kaitos, agresyvumas, gali sutrikti psichika. Taip pat kartais sukeliami ir nepageidaujami išvaizdos pokyčiai – pradeda plikti, padidėja plaukuotumas tose kūno zonose, kur dažniausiai nebūdinga, atsiranda odos pokyčiai. Anaboliniai steroidai yra paplitę ne tik kultūrizmo sporto šakoje, bet ir kitose kuriose yra reikalinga jėga“, – komentavo R. Banytė. Dar ekstremalesnis būdas, kurį naudojo ir R. Piana, yra sintolio injekcijos į raumenis. „Kai kurie žmonės galvoja, kad sintolis yra tam tikras anabolinis steroidas, tačiau iš tikro, tai aliejus, kuris sudarytas iš 85 proc. aliejaus, 7,5 proc. anestetiko ir 7,5 proc. alkoholio. Kultūristai šį iš karto veikti pradedantį preparatą leidžiasi į tas raumenų grupes, kurios lėčiau progresuoja dirbant, o artėjant varžyboms, reikia tą raumenį „iškelti“, – pasakojo ji. Medicinos srities vadybininkė atkreipė dėmesį, kad leidžiamas į raumenis ir kitus minkštuosius audinius sintolis gali sutrikdyti kraujotaką, sukelti infekciją. Kartais tai baigiasi galūnės praradimu arba mirtimi.
